var step=0,team=null;function main(){let e=new URLSearchParams(window.location.search);e.has("i")||(window.location="../index.html");var t=e.get("i");team=getTeam(t),console.log(team),document.getElementById("prev").style.visbility="hidden",getStep()}function getStep(){console.log(`Step : ${step}`);var e=0,t=null,n=document.getElementById("command");switch(step){case 0:case 1:e=0;break;case 2:case 3:e=1;break;case 4:case 5:e=2;break;default:e=10}if(10===e)return n.innerHTML="Done!",void(document.getElementById("next").style.visibility="hidden");t=step%2==0,console.log(`i : ${e}`);var i="";if(t){var a=e;a++,i=`owo team add ${team.animals[e].type} ${a}`}else i=`owow ${team.animals[e].weapon} ${team.animals[e].type}`;console.log(i),n.innerHTML=i,document.getElementById("prev").style.visibility=0===step?"hidden":"visible"}function next(){step++,getStep()}function prev(){document.getElementById("next").style.visibility="visible",step--,getStep()}